const dataList = [];
const generateList = (data) => {
    for (let i = 0; i < data.length; i++) {
        const node = data[i];
        const { key,title } = node;
        dataList.push({
            key,
            title: title,
        });
        if (node.children) {
            generateList(node.children);
        }
    }
};
